import React from 'react';
import { TextField, Button, TextareaAutosize} from '@material-ui/core';

function Compile() {
    return (
        <div>
            <h3>Enter the c++ code:</h3>
            <Folder name="william">
                alex
            </Folder>
            <TextareaAutosize 
                rowsMin={4}
            />
        </div>
    );
}

function clickButton(props) {
    console.log(props);
    return (
        <Button>
            Click me
        </Button>
    );
}
export default Compile;
